_DESCRIPTION_:
Источник питания для видеокамер SKAT-V.32 обеспечивает:
возможность ступенчатой регулировки напряжения каждой пары выходов от 12, 5 В до 16,8 В;
фильтрацию помех для устранения взаимного влияния нагрузок;
электронную защиту выходов от перегрузки по току, в том числе короткого замыкания;
электронную защиту от перегрева; защиту устройства и нагрузки от неправильного подключения клемм внешней АКБ;
защиту от короткого замыкания клемм внешней АКБ;
контроль наличия внешней АКБ;
регулируемый ток заряда АКБ;
защиту АКБ от глубокого разряда в режиме «Резерв»;
защиту от аварийного повышения выходного напряжения путем автоматического отключения устройства;
выдачу информационных сообщений о состоянии источника по пяти выходам типа «открытый коллектор»;
индикацию «выход» по каждой паре каналов.
